CREATE TABLE IF NOT EXISTS data (
player_id VARCHAR(9) NULL,
birth_year VARCHAR(0) NULL,
birth_month VARCHAR(2) NULL,
birth_day VARCHAR(2) NULL,
birth_country VARCHAR(14) NULL,
birth_state VARCHAR(22) NULL,
birth_city VARCHAR(26) NULL,
death_year VARCHAR(4) NULL,
death_month VARCHAR(2) NULL,
death_day VARCHAR(2) NULL,
death_country VARCHAR(14) NULL,
death_state VARCHAR(20) NULL,
death_city VARCHAR(26) NULL,
name_first VARCHAR(12) NULL,
name_last VARCHAR(14) NULL,
name_given VARCHAR(43) NULL,
weight VARCHAR(3) NULL,
height VARCHAR(2) NULL,
bats VARCHAR(1) NULL,
throws VARCHAR(1) NULL,
debut VARCHAR(10) NULL,
final_game VARCHAR(10) NULL,
retro_id VARCHAR(8) NULL,
bbref_id VARCHAR(9) NULL,
position VARCHAR(2) NULL,
ho_f VARCHAR(1) NULL
);

